      SELECT DISTINCT - 33 * - - 63 AS col2 FROM tab1 (FORMAT parquet) cor0 WHERE NOT col0 + CAST ( col0 AS INTEGER ) + + col2 - + col1 * - col2 IS NOT NULL;
  - name: tab1

outputs:
  - name: q8554.out
    data: |
